import React from 'react';
import ReactDOM from 'react-dom';

const name = 'Asad Aziz';

ReactDOM.render(
  <>
    <h1>My name is {name}</h1>
    <p>The sum of 5 and 5 is {5 + 5}</p>
  </>,
  document.getElementById("root")
);

